import { Router } from 'react-router-dom';
import logo from '../assets/logo.svg';
import '../styles/App.css';
import ProductList from './ProductList';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Router path="/ProductList" element={<ProductList/>}/>
      </header>
    </div>
  );
}

export default App;
